
<h2>AudienceSubcategory</h2>
<ul class="parameter">
  <li class="param-required-false">key : String
    <br/>Interest unique key (same as ID).
  </li>
</ul>
<ul class="parameter">
  <li class="param-required-false">name : String
    <br/>Subinterest name.
  </li>
</ul>
<ul class="parameter">
  <li class="param-required-false">ratio : BigDecimal
    <br/>Subinterest&#39;s percent of category&#39;s total audience.
  </li>
</ul>
<ul class="parameter">
  <li class="param-required-false">index : BigDecimal
    <br/>Subinterest affinity index.
  </li>
</ul>
<ul class="parameter">
  <li class="param-required-false">id : String
    <br/>Subinterest ID.
  </li>
</ul>
